@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:ATM rdf:type owl:Class .
atm:Function rdf:type owl:Class .
atm:Item rdf:type owl:Class .
atm:StateValue rdf:type owl:Class .
atm:withdrawal rdf:type atm:Function .
atm:transaction rdf:type atm:Item .
atm:successful rdf:type atm:StateValue .
atm:initiated rdf:type atm:StateValue .

atm:hasInitialFunctionSequence rdf:type owl:ObjectProperty ;
    rdfs:domain atm:ATM ;
    rdfs:range atm:Function .

atm:hasStateValue rdf:type owl:ObjectProperty ;
    rdfs:domain atm:Function ;
    rdfs:range atm:StateValue .

atm:setsItem rdf:type owl:ObjectProperty ;
    rdfs:domain atm:ATM ;
    rdfs:range atm:Item .

atm:hasItemState rdf:type owl:ObjectProperty ;
    rdfs:domain atm:Item ;
    rdfs:range atm:StateValue .

[ rdf:type owl:Axiom ;
  owl:antecedent [ rdf:type owl:Restriction ;
                   owl:onProperty atm:hasInitialFunctionSequence ;
                   owl:hasValue atm:withdrawal ] ;
  owl:consequent [ rdf:type owl:Restriction ;
                   owl:onProperty atm:hasStateValue ;
                   owl:hasValue atm:successful ] ] .

[ rdf:type owl:Axiom ;
  owl:antecedent [ rdf:type owl:Restriction ;
                   owl:onProperty atm:hasInitialFunctionSequence ;
                   owl:hasValue atm:withdrawal ] ;
  owl:consequent [ rdf:type owl:Restriction ;
                   owl:onProperty atm:setsItem ;
                   owl:hasValue atm:transaction ] ] .

[ rdf:type owl:Axiom ;
  owl:antecedent [ rdf:type owl:Restriction ;
                   owl:onProperty atm:setsItem ;
                   owl:hasValue atm:transaction ] ;
  owl:consequent [ rdf:type owl:Restriction ;
                   owl:onProperty atm:hasItemState ;
                   owl:hasValue atm:initiated ] ] .
